import React from 'react';

function Winners(props) {
    let winningTeam = '';
    let winningPlayers = '';
    let newGame = <button onClick={props.startGame} className='party-button'>New Game</button>;
    if(props.gameOver) {
        winningTeam = props.teamWinners + ' Win!'
        winningPlayers = 'Winners: ' + props.playerWinners
    }

   
    return (
        <div>
            {winningTeam}
            {winningPlayers}
            {newGame}
        </div>
    );
}

export default Winners;
